export default {
  data() {
    return {
      biaogeshuju: {},
      show: true,
      dialogVisible: false
    }
  },
  created() {
    this.$api.getchuangkoubiaoge({
      id: this.$route.params.id
    }).then(res => {
      console.log(res)
      this.biaogeshuju = res.data
    })
  },
  mounted() {},
  methods: {
    beginJf() {
      this.dialogVisible = true
    },
    jiefang() {
      this.$api.getchuangkouchange({
        id: this.$route.params.id
      }).then(res => {
        this.show = false
        this.dialogVisible = false
      }).catch(err => {
        console.log(err)
      })
    }
  }
}
